import React , {Fragment , useEffect , useState} from "react";
import MaterialTable from 'material-table';


 const TableSearch = () => {
    const data = [
        {
            Job: "Web  Developer",
            Category: "Software Development",
            Company: "Murex co.",
            Location: "Beirut,Lebanon",
        },
        {
            Job: "Business Administration",
            Category: "Business Development",
            Company: "Alpha co.",
            Location: "Beirut,Lebanon",
        },
        {
            Job: "HR Manager",
            Category: "Business Development",
            Company: "Omnetco.",
            Location: "Beirut,Lebanon",
        },
        {
            Job: "Web  Developer",
            Category: "Software Development",
            Company: "HiCartco.",
            Location: "Beirut,Lebanon",
        },
       
    ]
    
    const columns = [
        {
            title: "Job",
            field: "Job",
        },
       
        {
            title: "Company",
            field: "Company",
        },
        {
            title: "Location",
            field: "Location",
        },
        {
            title: "skills",
            field: "skills",
        },
    ]

    const [jobs , setJobs] = useState([]);

    const getJobs = async () => {
        try {

            const response = await fetch("http://localhost:3001/jobs");
            const jsonData = await response.json();

            setJobs(jsonData);
            
        } catch (err) {
            console.error(err.message);
        }
    };
    useEffect(() =>{
        getJobs();
    }, []);

    return(
        <div>
            <MaterialTable title="JobsSearched"
            data={setJobs}
            columns={columns}
            />

           
        </div>
    )

    
}
export default TableSearch;
